 - not available yet</p>\n                        <p>Here we show the average partial atomic charges for each charge scheme \n                        (Mulliken, APT, MK, CHelpG, HLY and NPA) computed using MOBCAL (in nitrogen buffer gas) \n                        with partial charges computed combination of functionals HF (<b>a</b>), B3LYP (<b>b</b>) and M05 (<b>c</b>)\n                        and basis sets \n                        STO-3G (<b><font color='#000080'>blue</font></b>), \n                        3-21G (<b><font color='#FF0080'>magenta</font></b>),\n                        6-31G (<b><font color='#008000'>green</font></b>), \n                        6-31+G (<b><font color='#FF8000'>orange</font></b>) \n                        and 6-31G* (<b><font color='#8009FF'>purple</font></b>).</p> \n                        <p><b>Interactive tools:</b></p>\n                        <p><b><font color='green'>Hover</b></font>  - hover over any data point and it will bring detailed information \n                        about partial atomic charge, standard error, atom ID</p>\n                        <p><b><font color='green'>Zoom</b></font> - drag on the plot to zoom on specific region of interest</p>\n                        <p><b><font color='green'>Legend</b></font> - click on legend marker to select/deselect datasets</p> ","width":800},"id":"755b89e1-6af9-48f1-8ccd-9e7640734e06","type":"Div"},{"attributes":{"background_fill_color":{"value":"#DCDCDC"},"click_policy":"hide","items":[{"id":"1795ceaf-6356-4025-86dd-424e309104a3","type":"LegendItem"},{"id":"e5a98d7f-8dbe-4071-b6ce-d7dd1fc7575e","type":"LegendItem"},{"id":"55020baa-b1e5-4d23-a7d2-f28e2ea4259f","type":"LegendItem"},{"id":"b0902f6a-24fb-4c1e-a35e-8c73b33b8a05","type":"LegendItem"},{"id":"2bc618ec-a2fc-4ea6-bbdb-200ee7a53b94","type":"LegendItem"}],"location":"bottom_center","orientation":"horizontal","plot":{"id":"dafca3e5-9dae-44cc-ae4d-7a72c96d4c1d","subtype":"Figure","type":"Plot"}},"id":"874966d7-e326-4a5 /b>), \n                        3-21G (<b><font color='#FF0080'>magenta</font></b>),\n                        6-31G (<b><font color='#008000'>green</font></b>), \n                        6-31+G (<b><font color='#FF8000'>orange</font></b>) \n                        and 6-31G* (<b><font color='#8009FF'>purple</font></b>).</p> \n                        <p><b>Interactive tools:</b></p>\n                        <p><b><font color='green'>Hover</b></font>  - hover over any data point and it will bring detailed \n                        information about partial atomic charge, standard error, atom ID</p>\n                        <p><b><font color='green'>Zoom</b></font> - drag on the plot to zoom on specific region of interest</p>\n                        <p><b><font color='green'>Legend</b></font> - click on legend marker to select/deselect datasets</p> ","width":800},"id":"bee44c01-c638-412c-8c88-379951b2f4c4","type":"Div"},{"attributes":{"fill_color":{"value":"#FF0080"},"size":{"units":"screen","value":10},"x":{"field":"x"},"y":{"field":"y"}},"id":"b288285a-5f5f-45d2-ae95-a3d7fa43c595","type":"Square"},{"attributes":{"fill_color":{"value":"#8009FF"},"size":{"units":"screen","value":10},"x":{"field":"x"},"y":{"field":"y"}},"id":"2d256386-14ee-4765-977d-f0c31875823f","type":"Square"},{"attributes":{"callback":null,"end":25.5,"start":0.5},"id":"e5a9e108-d44e-4461-b1a7-5acd150b1b2f","type":"Range1d"},{"attributes":{"axis_label":"CCS (\u00c5\u00b2)","axis_label_text_font_size":{"value":"14pt"},"axis_label_text_font_style":"bold","formatter":{"id":"236c73d3-3d76-4344-a29b-0bca93af5a0e","type":"BasicTickFormatter"},"major_label_text_font_size":{"value":"12pt"},"major_label_text_font_style":"bold","plot":{"id":"5d90f5ad-bb8d-44b9-b2a3-77e3349e0eff","subtype":"Figure","type":"Plot"},"ticker":{"id":"0898247e-d0ec-4d23-a942-7fd2f55ee204","type":"BasicTicker"}},"id":"7795f93b-7124-4dd1-8726-9a04712cdd05","type":"LinearAxis"},{"attributes":{"fill_color":{"value":"#000080"},"size":{"u c Charges of monosaccharides </font></font></b></p>\n                        <p><font size=\"2\"><b>Title</b>: A Careful Consideration of the Influence of Structure, Partial charges \n                        and Basis Sets on Collision Cross Sections of Monosaccharides when Comparing Values \n                        from DFT calculations to those Obtained Experimentally</p> \n                        <p><b>Authors</b>: Lukasz G. Migas, Christopher J. Gray, Sabine L. Flitsch and Perdita E. Barran</p>\n                        <p><b>DOI</b>: - not available yet</p>\n                        <p>Here we show the average partial atomic charges for each charge scheme \n                        (Mulliken, APT, MK, CHelpG, HLY and NPA) computed using MOBCAL (in nitrogen buffer gas) \n                        with partial charges computed combination of functionals HF (<b>a</b>), B3LYP (<b>b</b>) and M05 (<b>c</b>)\n                        and basis sets \n                        STO-3G (<b><font color='#000080'>blue</font></b>), \n                        3-21G (<b><font color='#FF0080'>magenta</font></b>),\n                        6-31G (<b><font color='#008000'>green</font></b>), \n                        6-31+G (<b><font color='#FF8000'>orange</font></b>) \n                        and 6-31G* (<b><font color='#8009FF'>purple</font></b>).</p> \n                        <p><b>Interactive tools:</b></p>\n                        <p><b><font color='green'>Hover</b></font>  - hover over any data point and it will bring detailed information \n                        about partial atomic charge, standard error, atom ID</p>\n                        <p><b><font color='green'>Zoom</b></font> - drag on the plot to zoom on specific region of interest</p>\n                        <p><b><font color='green'>Legend</b></font> - click on legend marker to select/deselect datasets</p> ","width":800},"id":"65641833-4466-482e-b0be-3a868dba3223","type":"Div"},{"attributes":{"fill_alpha":{"value":0.1},
